// File: src/pages/Home.js
import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-white text-center px-4">
      <h1 className="text-4xl font-bold mb-6 text-blue-700">Welcome to MediSync</h1>
      <p className="text-lg text-gray-600 mb-8 max-w-xl">
        A secure, AI-driven digital healthcare platform to manage medical records, consult doctors, and get smart AI health support.
      </p>
      <div className="flex space-x-4">
        <Link
          to="/login"
          className="bg-blue-600 hover:bg-blue-700 text-white px-6 py-2 rounded"
        >
          Login
        </Link>
        <Link
          to="/register"
          className="bg-gray-200 hover:bg-gray-300 text-gray-800 px-6 py-2 rounded"
        >
          Register
        </Link>
      </div>
    </div>
  );
};

export default Home;
